export default (function(a,b,c){return {data:{pXbH3fxN9P:{data:{id:269,attributes:{imdbId:"tt0044413",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZWQ2N2NmYTMtM2Q1OS00ODBlLTg4NDMtMWJlYzVjNWMwNDVkXkEyXkFqcGdeQXVyMjI4MjA5MzA@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.3\u002F10"},{Source:"Rotten Tomatoes",Value:"100%"}],item_lang:{data:{id:932,attributes:{title:"Bend of the River",plot:"Two men with questionable pasts, Glyn McLyntock and his friend Cole, lead a wagon-train load of homesteaders from Missouri to the Oregon territory. They establish a settlement outside of Portland and as winter nears, it is necessary for McLyntock and Cole to rescue and deliver food and supplies being held in Portland by corrupt officials. On the trip back to the settlement, up river and over a mountain, Cole engineers a mutiny to divert the supplies to a gold mining camp for a handsome profit.",slug:"bend-of-the-river"}}},books:{data:[{id:2864,attributes:{title:"Cowboy Courage",description:"Film and television Westerns are most often associated with physical bravery. However, many--especially those produced during the \"Golden Age\" of Westerns from the late 1940s through the early 1960s--also demonstrate moral bravery (the willingness to do the right thing even when met with others' disapproval) and psychological bravery (the ability to overcome one's fear and inner conflict to bring out the best in oneself and others). Through a close examination of Westerns displaying all three types of bravery, the author shows us how courage can lead to, and even enrich, other virtues like redemption, authenticity, love, friendship, allegiance to one's community, justice, temperance, and growing up and growing old successfully.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=1C6NDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["William Hampes"],firstBook:true,published:"2019-03-14",publisher:c,subtitle:"Westerns and the Portrayal of Bravery"}},{id:2865,attributes:{title:"Anthony Mann",description:"\"This detailed study of Anthony Mann argues Mann's prominence and influence alongside contemporaries like John Ford. Mann (1906-1967), he was best known for his film noir and westerns and his work starring Jimmy Stewart, but later moved into Cold War ande",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=q_5PAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["William Darby"],firstBook:b,published:"2009-07-13",publisher:c,subtitle:"The Film Career"}},{id:2866,attributes:{title:"The Psychology of the Western",description:"Western films are often considered sprawling reflections of the American spirit. This book analyzes the archetypes, themes, and figures within the mythology of the western frontier. Western themes are interpreted as expressions of cultural needs that perform specific psychological functions for the audience. Chapters are devoted to the frontier hero character, the roles of women and Native Americans, and the work of the genre's most prolific directors, Anthony Mann and John Ford. The book includes a filmography and movie stills. Instructors considering this book for use in a course may request an examination copy here.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=NE0-EAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["William Indick"],firstBook:b,published:"2014-11-21",publisher:c,subtitle:"How the American Psyche Plays Out on Screen"}},{id:2867,attributes:{title:"New Brunswick in History",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=XXQoBOi3Ct4C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["William H. Benedict"],firstBook:b,published:"1925-01-01",publisher:a,subtitle:a}},{id:2868,attributes:{title:"The Independent",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=JLPPAAAAMAAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["William Livingston"],firstBook:b,published:"1915-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940920350}}("",null,"McFarland"))